/**
 * DFS + 剪枝
 * @param {number[][]} matrix
 * @return {number[][]}
 */
var updateMatrix = function(matrix) {
    var count = [];
    if (matrix.length === 0) return matrix;
    for (var i = 0; i < matrix.length; i ++) {
      for (var j = 0; j < matrix[0].length; j++) {
        if (matrix[i][j] === 1 && !hasNeiverZero(matrix, i, j)) {
          matrix[i][j] = matrix.length + matrix[0].length + 1;
        }
      }
    }
    for (var k = 0; k < matrix.length; k ++) {
      for (var l = 0; l < matrix[0].length; l ++) {
        if (matrix[k][l] === 1) {
          go(matrix, k, l, -1);
        }
      } 
    }
    return matrix;
};

function go(matrix, x, y, val) {
  if (x < 0 || y < 0 || y >= matrix[0].length || x >= matrix.length || matrix[x][y] <= val) {
    return;
  }
  if (val > 0) {
    matrix[x][y] = val;
  }
    go(matrix, x, y - 1, matrix[x][y]+1)
    go(matrix, x + 1, y, matrix[x][y]+1);
    go(matrix, x, y + 1, matrix[x][y]+1);
    go(matrix, x - 1, y, matrix[x][y]+1);
}

function hasNeiverZero(matrix, x, y) {
  if (x > 0 && matrix[x - 1][y] === 0) return true;
  if (x < matrix.length - 1 && matrix[x + 1][y] === 0) return true;
  if (y > 0 && matrix[x][y - 1] === 0) return true;
  if (y < matrix[0].length - 1 && matrix[x][y + 1] === 0) return true;

  return false;
}

